:root {--pridark:  #2D2F3B;--primid:  #364552;--prilight:  #77ABB9;--secdark:  #CE4943;--secmid:  #ABC3A1;--seclight:  #D6CF88;--white: #fcfcfa;--maxwidth: 800px;}body {width: 92%;max-width: var(--maxwidth);margin: 0 auto;font-size: 10pt;padding: 3em 0 10em 0;font-family: 'Source Code Pro', monospace;color: #000000;line-height: 2.2em;text-align: left;font-weight: 400;overflow-y: scroll;background-color: var(--white);text-align: center;}a {text-decoration: none;color: var(--secmid);}a:hover {color: var(--secdark);}.top-bar {width: 92%;max-width: var(--maxwidth);height: 3em;position: fixed;top: 0;left: 0.5;display: flex;justify-content: space-between;flex-wrap: wrap;align-items: center;z-index: 5;font-weight: 500;}.top-bar::before {width: 100%;height: 3em;content: "";position: fixed;top: 0;left: 0;background-color: var(--pridark);z-index: -1;}.site-title {color: var(--white);}#nav-menu-container {width: 0;height: 100%;max-width: 80%;position: fixed;z-index: 15;top: 0;right: 0;background-color: var(--primid);overflow-x: hidden;transition: 0.3s;text-align: left;margin: 0;}#nav-menu-container > ul {margin: 1em;}#nav-menu-container > ul {list-style: none;padding: 0;line-height: 1.2em;}#nav-menu-container > ul > li {margin: 0.7em 0 0.7em 0;margin: 1em 0 0 0;}.icon-container {display: inline-block;padding-top: 1em;border-top: 1px solid var(--prilight);width: 100%;}.fa, .fab {font-size: 1.3em;text-decoration: none;margin-right: 0.5em;}#nav-menu-container > ul > li > a,#close-nav,#open-nav {color: var(--prilight);transition: 0.3s;}#nav-menu-container > ul > li > a.nav-link,#nav-menu-container > ul > ul > li > a.nav-link{color: var(--white);text-decoration: none;transition: 0.3s;}#nav-menu-container > ul > li > a:hover,#nav-menu-container > ul > ul > li > a.nav-link:hover, #close-nav:hover,#open-nav:hover {color: var(--secmid);}#close-nav {height: 2em;margin: 0.65em 1em;padding-bottom: 0.33em;border-bottom: 1px solid var(--prilight);}#overlay {transition-duration: 0.2s;width: 100%;height: 100%;z-index: -10;position: fixed;left: 0;top:0;}.accordion {background-color: none;width: 100%;text-align: left;outline: none;text-decoration: italic;color: var(--prilight);}.accordion > p {margin-block-start: 0;margin-block-end: 0;}.accordion:before {content: '\002B';float: right;margin-left: 5px;color: var(--prilight);}.active:before {content: "\2212";}.panel {max-height: 0;overflow: hidden;transition: max-height 0.5s ease-out;padding: 0;border-bottom: 1px solid #00000030;}ul.panel {list-style: none;}ul.panel > li {padding: 0 0 0.5em 1em;}h1 {color: var(--secdark);font-size: 1.4em;font-weight: 400;}h2 {color: var(--secmid);font-size: 1.15em;font-weight: 400;}code {font-family: 'Ubuntu Mono', monospace;color: var(--prilight);}pre > code {color: black;}pre {font-family: 'Ubuntu Mono', monospace;font-size: 10pt;border: 1px solid #ddd;border-radius: 0.6em 0 0 0;padding: 0.5em 1em;margin: 2em 0;white-space: pre-wrap;overflow-x: auto;line-height: 1.4em;color: #444f5c;background-color: white;max-height: 24em;overflow-y: auto;-moz-box-shadow: inset 0 0 6px #00000020;-webkit-box-shadow: inset 0 0 6px #00000020;box-shadow: inset 0 0 6px #00000020;}pre.r, pre.python, pre.code_in {max-height: 48em;border-color: var(--prilight);}table {width: 100%;overflow-x: auto;border-collapse: collapse;text-align: left;}td {padding: 0.5em 0;vertical-align: top;}td > p {margin: 0 auto;}td:first-child {text-align: right;padding-right: 1em;}td:nth-child(2) {border-left: 1px solid #f5c507;padding-left: 1em;}.subtle {color: #bcbcbc;}.center {text-align:center}.large-img {display: block;width: 85%;max-width:600px;margin: 0 auto;}.mid-img {display: block;width: 75%;max-width:450px;margin: 0 auto;}.task{color: var(--secdark)}@media only screen and (min-width: 600px) {body {text-align: justify;}}</style>

<script>
  var acc = document.getElementsByClassName("accordion");
  var i;

  for (i = 0; i < acc.length; i++) {
    acc[i].addEventListener("click", function() {
      this.classList.toggle("active");
      var panel = this.nextElementSibling;
      if (panel.style.maxHeight) {
        panel.style.maxHeight = null;
        panel.style.marginTop = null;
      } else {
        panel.style.maxHeight = panel.scrollHeight + "px";
        panel.style.marginTop = "0.5em";
      }
    });
  }
</script>
